import React from 'react';

function VideosForm({ videoData, onSubmit, isSaving, onChange, editingVideo }) {
  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit();
  };

  return (
    <div className="Video-Search-Box">
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="url"
          placeholder="Video URL"
          value={videoData.url}
          onChange={onChange}
          className="video-search-input"
        />
        <textarea
          name="description"
          placeholder="Video Description"
          value={videoData.description}
          onChange={onChange}
          className="video-search-input"
        ></textarea>
        
        {/* New fields added here */}
        <input
          type="text"
          name="site"
          placeholder="Video Site"
          value={videoData.site || ''}
          onChange={onChange}
          className="video-search-input"
        />
        
        <input
          type="text"
          name="videoKey"
          placeholder="Video Key"
          value={videoData.videoKey || ''}
          onChange={onChange}
          className="video-search-input"
        />
        
        <input
          type="text"
          name="videoType"
          placeholder="Video Type"
          value={videoData.videoType || ''}
          onChange={onChange}
          className="video-search-input"
        />

        <select
          name="official"
          value={videoData.official || 'No'}
          onChange={onChange}
          className="video-search-input"
        >
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>

        <div className="video-search-buttons">
          <button
            type="submit"
            className="search-btn"
            disabled={isSaving}
          >
            {isSaving ? 'Saving...' : editingVideo ? 'Update Video' : 'Add Video'}
          </button>
        </div>
      </form>
    </div>
  );
}

export default VideosForm;
